import React from "react";
import Card from "./Card";

const Cardlist = ({ robot }) => {
  const a = (num, ind, arr) => {
    return <Card title={robot[ind].name} />;
  };

  const b = robot.map(a);

  return <div>{b}</div>;
};

export default Cardlist;
